import React from "react";

function Footer() {
  return (
    <>
      <footer class="footer"><div class="container"><div class="footer__top"><a href="/" class="logo"><img width="38" src="img/dodo-logo.jpg" alt="Pizza logo" /><img width="38" src="img/dodo-logo.jpg" alt="Pizza logo" />
            <div>
              <h1>ДОДО ПИЦЦА</h1>
              <p>Сеть пиццерий № 1 в России</p>
            </div></a><div class="footer__phone"><a class="footer__number" href="tel:+88007006163">8 800-700-61-63</a><p class="footer__phone-text">Заказать по телефону</p></div></div><div class="footer__main"><ul class="footer__list"><li class="footer__item item-footer"><h3 class="item-footer__title">Компания</h3><ul class="item-footer__list"><li class="item-footer__item"><a href="" class="item-footer__link">О нас</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Поставщикам</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Арендодателям</a></li></ul></li><li class="footer__item item-footer"><h3 class="item-footer__title">Гостям</h3><ul class="item-footer__list"><li class="item-footer__item"><a href="" class="item-footer__link">Качество</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Состав и калорийность блюд</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Аллергены</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Правовая информация</a></li></ul></li><li class="footer__item item-footer"><h3 class="item-footer__title">Ресторан и доставка</h3><ul class="item-footer__list"><li class="item-footer__item"><a href="" class="item-footer__link">Адреса ресторанов</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Условия доставки</a></li></ul></li><li class="footer__item item-footer"><h3 class="item-footer__title">Наши сообщества</h3><ul class="item-footer__list"><li class="item-footer__item"><a href="" class="item-footer__link">Инстаграм</a></li><li class="item-footer__item"><a href="" class="item-footer__link">Вконтакте</a></li></ul></li></ul></div><div class="footer__bottom bottom-footer"><div class="bottom-footer__content"><p class="bottom-footer__descr">Мы заботимся о том, <br />чтобы сделать ваш отдых особенным</p></div><div class="bottom-footer__copyright"><p class="bottom-footer__policy">© 2024 ДОДО ПИЦЦА. Все права защищены</p></div></div></div></footer>
    </>
  );
}

export default Footer;
